import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <img src='https://i.playground.ru/p/Gz1qMTWoWlPxOQflLwe7XQ.jpeg' />
    </header>
}

export default Header;
